import { Component,Output,EventEmitter } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'app';

  popUpValue?:boolean= true;
  @Output()
  addpopupWinow:EventEmitter<boolean> = new EventEmitter<boolean>();
  closeValue:boolean = false;

  addpopValue(){
    this.closepopup.emit(this.closeValue)
  }
}
